import React, { Component } from 'react';

export default class Login extends Component {
    render() {
        return(
            <div>
                <h1>Login</h1>
                <label>
                    Username:
                    <input type="text" name="username"/>
                </label>
                <br/>
                <label>
                    Password:
                    <input type="text" name="password"/>
                </label>
                <button onClick={Login}>Login</button>
            </div>
        );
    }
    
}
